const item = $input.item.json;

console.log('\n' + 'â”'.repeat(60));
console.log(`ðŸŽ¬ PROCESSING LINE ${item.lineNumber} (${item.itemIndex} of ${item.totalItems})`);
console.log('â”'.repeat(60));
console.log('ðŸŽ¤ Speaker:', item.speaker);
