const items = $input.all();

console.log('\n' + 'â•'.repeat(60));
console.log('ðŸ“Š BATCH PROCESSING COMPLETE');
console.log('â•'.repeat(60));

const successItems = items.filter(i => i.json.status === 'success');
const audioErrors = items.filter(i => i.json.status === 'audio_error');
const uploadErrors = items.filter(i => i.json.status === 'upload_error');

console.log('Total items:', items.length);
console.log('âœ… Successful:', successItems.length);
console.log('âŒ Audio errors:', audioErrors.length);
console.log('âŒ Upload errors:', uploadErrors.length);

console.log('');
