console.log('â”€'.repeat(60));

items.forEach(item => {
  const data = item.json;
  const icon = data.status === 'success' ? 'âœ…' : 'âŒ';
  console.log(`${icon} Line ${data.lineNumber} (${data.speaker} - ${data.section}): ${data.status}`);

  if (data.status === 'success') {
    console.log(`   URL: ${data.secureUrl}`);
    console.log(`   Size: ${data.fileSize}, Duration: ${data.duration}`);
  } else if (data.error) {
    console.log(`   Error: ${data.error}`);
  }
  console.log('');
});

console.log('â•'.repeat(60));
console.log('ðŸ WORKFLOW COMPLETE');
console.log('â•'.repeat(60));

return [{
  json: {
    summary: {
      totalProcessed: items.length,
      successful: successItems.length,
      audioErrors: audioErrors.length,
      uploadErrors: uploadErrors.length,
      successRate: Math.round((successItems.length / items.length) * 100) + '%'
    },
    results: items.map(i => i.json),
    timestamp: new Date().toISOString(),
    method: 'PROVEN_ACG_CLOUDINARY_METHOD'
  }
}];
